-- 表结构导出
DROP TABLE IF EXISTS `dim_location`;
CREATE TABLE `dim_location` (
  `location_id` int NOT NULL AUTO_INCREMENT,
  `longitude` decimal(10,6) NOT NULL COMMENT '经度',
  `latitude` decimal(10,6) NOT NULL COMMENT '纬度',
  `country_id` int DEFAULT NULL,
  `province` varchar(100) DEFAULT NULL COMMENT '省/州',
  `city` varchar(100) DEFAULT NULL COMMENT '城市',
  `address` varchar(500) DEFAULT NULL COMMENT '详细地址',
  `postal_code` varchar(20) DEFAULT NULL,
  `timezone` varchar(50) DEFAULT NULL COMMENT '时区',
  `createdAt` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updatedAt` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`location_id`),
  UNIQUE KEY `uk_lng_lat` (`longitude`,`latitude`),
  KEY `idx_location_coords` (`longitude`,`latitude`),
  KEY `idx_location_country` (`country_id`),
  CONSTRAINT `dim_location_ibfk_1` FOREIGN KEY (`country_id`) REFERENCES `dim_country` (`country_id`),
  CONSTRAINT `chk_latitude_range` CHECK (((`latitude` >= -(90)) and (`latitude` <= 90))),
  CONSTRAINT `chk_longitude_range` CHECK (((`longitude` >= -(180)) and (`longitude` <= 180)))
) ENGINE=InnoDB AUTO_INCREMENT=4096 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='地理位置维度表';

